  false,\n\t\"url\": null,\n\t\"notes\": \"A large part of CWTD Recovery has hinged
  on translocation of deer to their former range.  Much of CWTD historical range,
  however, is now on or near private land.  Because deer do not necessarily remain
  where they are released, they must be monitored to determine whether they have migrated
  to urban areas or have the potential to cause agricultural damage.  Because state
  agencies generally deal with animal damage complaints, they are particularly concerned
  with CWTD movements.  Under the agreement struck with the States and Cowlitz tribe
  described in the monitoring plan for the Ridgefield and Cottonwood Island translocations,
  these deer will be monitored until the collars are no longer functional.In addition
  to tracking movements onto private lands, monitoring allows the tracking of mortality
  rates and gives a good estimate of population size for the first few years.\",\n\t\"owner_org\":
